import React, { Component } from 'react';
import '../App.css';

class Error extends Component {
  render() {
    return (
      <div>
      <div className='bg-container-layout'>
          <h1 class='font-default'>Halaman Tidak Ditemukan</h1>
      </div>
      </div>
    );
  }
}

export default Error;
